import React, { memo } from "react";
import { shallowEqual, useSelector, useState } from "react-redux";

import LJThemeHeaderRanking from "@/components/theme-header-ranking";

import { LJRankingListWrapper } from "./style";

export default memo(function LJRankingList() {
  // redux hooks
  const [state, setstate] = useState(initialState);

  const { playList } = useSelector(
    (state) => ({
      playList: state.getIn(["ranking", "playList"]),
    }),
    shallowEqual
  );

  // react hooks

  // handle function
  const tracks = playList.tracks;

  return (
    <LJRankingListWrapper>
      <LJThemeHeaderRanking />
      <table>
        <thead>
          <tr>
            <th className="ranking"></th>
            <th className="title">
              <div className="content">标题</div>
            </th>
            <th className="duration">
              <div className="content">时长</div>
            </th>
            <th className="singer">
              <div className="content">歌手</div>
            </th>
          </tr>
        </thead>
        <tbody>
          <tr className="item">
            <td>
              <div className="num">
                <span className="text">1</span>
                <span className="iconN sprite_icon2"></span>
              </div>
            </td>
            <td>
              <div className="info">
                <img
                  src="http://p3.music.126.net/5jBz_uLtQhET09Y3W2Tm2Q==/109951166570035556.jpg?param=50x50"
                  alt=""
                />
                <span className="play sprite_table"></span>
                <span className="title">情人</span>
              </div>
            </td>
            <td>06:54</td>
            <td>李荣浩</td>
          </tr>
        </tbody>
      </table>
    </LJRankingListWrapper>
  );
});
